using System;
using System.Collections.Generic;
using System.IO;
using System.Linq;
using System.Net;
using System.Reflection;
using System.Text;
using System.Threading.Tasks;

namespace CobaltStrikeScannerLoader
{
    public class Program
    {

        static readonly string PAYLOAD = @"";

        public static void Main()
        {
            /*
            byte[] file = File.ReadAllBytes(@"C:\Users\No\Desktop\ConsoleUI.exe");
            string fileb64 = Convert.ToBase64String(file);
            System.IO.File.WriteAllText(@"C:\Users\<username>\Desktop\b64.txt", fileb64);*/


            string HostName = Dns.GetHostName();
            string csPath = @"C:\CS\";
            System.IO.Directory.CreateDirectory(csPath);
            using (StreamWriter writer = new StreamWriter(csPath + HostName + "_CobaltStrikeMemoryScan.txt"))
            {
                Console.SetOut(writer);
                Assembly SampleAssembly;
                try
                {
                    byte[] payload = Convert.FromBase64String(PAYLOAD);
                    SampleAssembly = Assembly.Load(payload);
                    MethodInfo method = SampleAssembly.EntryPoint;

                    if (method != null)
                    {
                        // Get the type that implements the EntryPoint method
                        var implementingType = method.DeclaringType;
                        // Call the EntryPoint method, passing in an empty array of strings as its parameters
                        method.Invoke(implementingType, new object[] { new string[] { "-p" } });
                    }
                }
                catch (Exception ex)
                {
                    Console.WriteLine(ex.Message);
                }
            }            
        }
    }
}